description:
Ah, to be torrenting once again...perhaps I\&amp;#039;ll return to uploading stuff to USENET once again, after this. 

This is a collection of Jim Steranko\&amp;#039;s work on Nick Fury, as requested by an Anonymous /co/mrade at 4chan\&amp;#039;s /co/ (Comics &amp; Cartoons) board. Not all of his Nick Fury artwork is collected in this though.

}}Issues collected{{

Strange Tales v1 #151-168:
- #151-153 (over Jack Kirby layouts), #154-168
- Odd-number covers from #151 (inker only), #153-167 (Dec. 1966 - May 1968)

Nick Fury: Agent of S.H.I.E.L.D. #1-7:
- #1-3, 5, plus covers
- Covers only, #4,6-7 (June-Dec. 1968)

}}Missing{{

Nick Fury and His Agents of S.H.I.E.L.D. #1-2 (covers only; Feb. &amp; April 1973)
Nick Fury vs. S.H.I.E.L.D. #1 (cover only; June 1988)
